 ,(456,' TERMS &amp; CONDITIONS...  \r\n Brandrehab Limited - The Company Conditions of Contract \r\n These conditions shall apply to all goods and services supplied by The Company. Any provision, stipulation or condition in the client\'s conditions or order or otherwise which conflicts with or in any way qualifies or negates any of these Conditions of Contract shall have no effect and these Conditions of Contract shall prevail. \r\n 1. Company Undertaking The Company shall use all reasonable endeavours to supply the best possible service using its resources and talents to best effect within any agreed time, budgetry and briefing constraints. \r\n 2. Copyright The copyright of any design, for the purpose for which it was commissioned, will pass to the client on completion of the project subject to the agreed fee for the total work being paid in full. In certain circumstances, the commissioning of third party consultants i.e. illustrators, photographers, copywriters, lettering artists and model makers will require separate copyright negotiations. The Company accepts no responsibility for obtaining such agreements but will always attempt to secure in the client\'s favour. \r\n 3. Design Registration The client will be responsible for the registration of a design, if it is considered necessary. \r\n 4. Artwork and Proofs The Company reserves the right to produce all artwork that emanates from a design project and to view printed proofs prior to final production. It is the client\'s responsibility to ensure all artwork and proofs are correct prior to production. \r\n 5. Patents Any patentable material arising directly out of work on the project commissioned will automatically become the property of the client (unless separately negotiated), subject to the agreed fees being paid in full. \r\n 6. Estimates and Charges i) An estimate is not an offer and any given order in respect of an estimate shall not be binding on The Company until accepted by The Company in writing. ii) The Company will charge for its costs and expenses for the written and agreed supply of goods and services. Unless otherwise stated, all charges are exclusive of VAT. iii) The Company reserves the right to issue stage or advance invoices on projects lasting more than one month and costing more than £5,000. iv) It is the policy of The Company to charge all out of pocket expenses separately and at cost. \r\n 7. Publicity The client may not use The Company\'s name in connection with any publicity arising out of the project unless specific approval is given by The Company. \r\n 8. Ownership and Storage of Material i) All artwork and commissioned photography become the property of the client as and when payment is made in full. Original illustration remains the property of the artist/s, as the client in effect purchases only reproduction rights, although a separate agreement can be made for outright purchases. ii) Printed matter becomes the property of the client as and when full payment is made. iii) Any material stored on the client\'s behalf by The Company shall be held at the client\'s own risk. The Company accepts no liability for loss or damage to such material however caused. In addition, The Company will only reasonably store such materials for a period not exceeding 6 months. \r\n 9. Force Majeure Should The Company be prevented from completing or delivering, or the client be prevented from accepting delivery by reason of any industrial dispute, fire, breakdown, or other circumstances beyond their control, the time for completion/delivery shall be extended until the causes preventing completion/delivery or acceptance have ceased. \r\n 10. Terms of Payment Prices quoted are net and accounts are due for payment not later than 30 days from the date of the invoice. \r\n 11. Cancellation of Project Where a contract is postponed or cancelled by the client, a fee will be charged appropriate to the amount of work carried out on the project before its cancellation, taking into account any forward commitments for the project entered into by The Company. \r\n 12. Miscellaneaous The Company will at its own expense provide a minimum of three (3) types of biscuit at any client meeting taking place at The Company\'s premises of which one (1) must be chocolate covered…. subject to availability. \r\n    ','Terms and Confitions','','/footer/terms-and-conditions','2012-08-28 10:57:00','2012-09-03 13:49:01',NULL,0)
