 ,(3,'')
 ,(6,'');

DROP TABLE IF EXISTS btContentFile;

CREATE TABLE IF NOT EXISTS `btContentFile` (
  `bID` int(10) unsigned NOT NULL,
  `fID` int(10) unsigned DEFAULT NULL,
  `fileLinkText` varchar(255) DEFAULT NULL,
  `filePassword` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`bID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS btContentImage;

CREATE TABLE IF NOT EXISTS `btContentImage` (
  `bID` int(10) unsigned NOT NULL,
  `fID` int(10) unsigned DEFAULT '0',
  `fOnstateID` int(10) unsigned DEFAULT '0',
  `maxWidth` int(10) unsigned DEFAULT '0',
  `maxHeight` int(10) unsigned DEFAULT '0',
  `externalLink` varchar(255) DEFAULT NULL,
  `internalLinkCID` int(10) unsigned DEFAULT '0',
  `forceImageToMatchDimensions` int(10) unsigned DEFAULT '0',
  `altText` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`bID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

INSERT INTO btContentImage VALUES(15,1,0,0,0,'',0,0,'');

DROP TABLE IF EXISTS btContentLocal;

CREATE TABLE IF NOT EXISTS `btContentLocal` (
  `bID` int(10) unsigned NOT NULL,
  `content` longtext,
  PRIMARY KEY (`bID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

INSERT INTO btContentLocal VALUES(1,'	<div id=\"newsflow-header-first-run\"><h1>Welcome to concrete5.</h1>\n						<h2>It\'s easy to edit content and add pages using in-context editing.</h2></div>\n						')
 ,(2,'<div class=\"newsflow-column-first-run\">\n							<h3>Building Your Own Site</h3>\n							<p>Editing with concrete5 is a breeze. Just point and click to make changes.</p>\n							<br/>\n							<p><a href=\"javascript:void(0)\" onclick=\"ccm_getNewsflowByPath(\'/welcome/editors\')\" class=\"btn primary\">Editor\'s Guide</a></p>\n							</div>')
 ,(3,'<div class=\"newsflow-column-first-run\">\n							<h3>Developing Applications</h3>\n							<p>If you’re comfortable in PHP concrete5 should be a breeze to learn. Take a few moments to understand the architecture.</p>\n							<p><a href=\"javascript:void(0)\" onclick=\"ccm_getNewsflowByPath(\'/welcome/developers\')\" class=\"btn primary\">Developer\'s Guide</a></p>\n							</div>')
 ,(4,'<div class=\"newsflow-column-first-run\">\n							<h3>Designing Websites</h3>\n							<p>Good with CSS and HTML? You can easily theme anything with concrete5.</p>\n							<br/>\n							<p><a href=\"javascript:void(0)\" onclick=\"ccm_getNewsflowByPath(\'/welcome/designers\')\" class=\"btn primary\">Designer\'s Guide</a></p>\n							</div>')
 ,(5,'\n						<div class=\"newsflow-column-first-run\">\n						<h3>Business Background</h3>\n						<p>Worried about license structures, white-labeling or why concrete5 is a good choice for your agency?</p>\n						<p><a href=\"javascript:void(0)\" onclick=\"ccm_getNewsflowByPath(\'/welcome/executives\')\" class=\"btn primary\">Executive\'s Guide</a></p>\n						</div>')
 ,(13,'')
 ,(17,'<div class=\"row\" style=\"background:#e30a0a;top:0px;\">\r\n    <div class=\"sprite\" style=\"left:-15px;top:195px;\">\r\n        <div class=\"meta\">speedX:1,speedY:1</div>\r\n        <div class=\"spriteText\">\r\n            <div class=\"spriteText\">\r\n                <h1>INSTANT<br/> GROWTH</h1></div>\r\n            </div>\r\n        </div>\r\n    <div class=\"sprite\" style=\"left:779px;top:447px\">\r\n        <div class=\"meta\">speedX:1,speedY:1</div>\r\n        <a class=\"readMore\">read more</a>\r\n    </div>\r\n\r\n    <div class=\"sprite\" style=\"left:1290px;top:200px;width:429px;\">\r\n        <div class=\"meta\">speedX:0.31,speedY:1</div>\r\n        <div class=\"spriteText\">\r\n            <p>Soul Patch, Handlebar… what could be more fun than snapping your mates and then \'accidentally\' emailing all their Facebook friends with their \'new\' look….oops! Our addictive new app and Facebook page has enabled Remington to engage with their consumers in a totally new way with over 100,000 European fans on Facebook.<p/>\r\n        </div>\r\n    </div>\r\n    <div class=\"sprite\" style=\"background-image: url(\'images/remington-iphone-large.png\');width:823px;height:1086px;left:3079px;top:56px;\">\r\n        <div class=\"meta\">speedX:1.89,speedY:1</div>\r\n    </div>\r\n    <div class=\"sprite\" style=\"background-image: url(\'images/remington-gftg-facebook-iPad.png\');width:727px;height:773px;left:3586px;top:16px;\">\r\n        <div class=\"meta\">speedX:1.6,speedY:1</div>\r\n    </div>\r\n    <div class=\"sprite\" style=\"background-image: url(\'images/remington-gftg-banner.png\');width:251px;height:717px;left:4934px;top:22px;\">\r\n        <div class=\"meta\">speedX:1.25,speedY:1</div>\r\n    </div>\r\n    <div class=\"sprite\" style=\"background-image: url(\'images/remington-gftg-leaflet.png\');width:1307px;height:466px;left:7020px;top:240px;\">\r\n        <div class=\"meta\">speedX:3.0,speedY:1</div>\r\n    </div>\r\n\r\n    <div class=\"sprite\" style=\"background-image: url(\'images/remington-gftg-booklet1.png\');width:723px;height:409px;left:5778px;top:52px;\">\r\n        <div class=\"meta\">speedX:2.57,speedY:1</div>\r\n    </div>\r\n\r\n    <div class=\"sprite\" style=\"background-image: url(\'images/remington-gftg-cover.png\');width:780px;height:764px;left:5742px;top:78px;\">\r\n        <div class=\"meta\">speedX:1.20,speedY:1</div>\r\n    </div>\r\n    <div class=\"sprite\" style=\"background-image: url(\'images/remington-gftg-leafletStand.png\');width:598px;height:509px;left:5513px;top:8px;\">\r\n        <div class=\"meta\">speedX:0.63,speedY:1</div>\r\n    </div>\r\n    <div class=\"sprite\" style=\"background-image: url(\'images/remington-gftg-trader.png\');width:1246px;height:835px;left:11284px;top:42px;\">\r\n        <div class=\"meta\">speedX:2.96,speedY:1</div>\r\n    </div>\r\n\r\n    <div class=\"sprite\" style=\"background-image: url(\'images/remington-gftg-wobbler.png\');width:746px;height:666px;left:7605px;top:22px;\">\r\n        <div class=\"meta\">speedX:2.3,speedY:1</div>\r\n    </div>\r\n\r\n</div>')
