 ,(2243,'<p><span class=\"emphasize\">LEGAL INFORMATION...</span> Terms of use and privacy statement for brand-rehab.co.uk (“The Website”)</p>\r\n<p><strong>1. Introduction</strong><br />This is the official Website of Brandrehab Limited. It is intended to serve as an introduction to our firm, by giving an outline of our services and by providing details of how we can be contacted.<br />The terms and conditions set out below govern the use by you of the Website. In using the website you agree to these terms.<br />We reserve the right to change the terms of use of the Website at any time and you are requested to check the terms of use from time to time to ensure that you have seen the latest version.</p>\r\n<p><strong>2. Copyrights and Trademark</strong><br />Subject to the provisions below, the copyright in all content, graphics, tables, images and underlying codes of the Website belongs to us and is hereby asserted. Any copying or modification of all or any part of the Website is hereby prohibited with the exception that clients and prospective clients are welcome to take a copy of the pages of the Website, which do not contain materials relating to our clients, as a record of its contents and for personal use only.<br />The Website also contains materials belonging to our clients. These material are used solely for the purpose of promoting the range of services offered by us and are for display only. Any copying of such materials is strictly prohibited. Please contact us if you require any further clarification in this regard.<br />We hereby assert and reserve all our copyright, design right, moral rights, the moral rights of our employees, community design rights and all other rights in law of whatever type anywhere in the world to protect our intellectual property, goodwill and reputation.</p>\r\n<p><strong>3. Use of cookies</strong><br />The website, and subsequent sub-domains of the website uses cookies to store information about visits in order to improve your experience and to allow the website to provide content that is more relevant to the visitor. The website also uses Google Analytics to record visitor data. We use this data solely for our own purposes of improving the website. The data is not shared or sold to any third parties. We do not use any data for the purpose of providing advertising or promoting third parties.</p>\r\n<p><strong>4. Links to other websites</strong><br />The Website may contain links to other websites. We do not endorse or confirm the contents of any such website and accept no liability or responsibility for the contents or the use of such website. Please read the privacy statements upon entry to a linked website.</p>\r\n<p><strong>5. Virus Disclaimer</strong><br />Reasonable steps have been taken to protect this Website by anti virus software but all visitors are advised to take all necessary steps to ensure that no virus contamination occurs. No responsibility can be accepted for any loss or damage sustained as a consequence of any virus transmission.</p>\r\n<p><strong>6. Mailings</strong><br />Newsletters and occasional mailings are made to those of the users, who have given their prior consent to it. If you do not wish to continue to receive such mailings or would like to subscribe to them, please contact admin@brand-rehab.co.uk</p>\r\n<p><strong>7. Compliance</strong><br />All parties are required to comply with UK legislation relating to websites and e-commerce.</p>\r\n<p><strong>8. Unauthorised Use of the Website</strong><br />The following uses are unauthorised, a breach of these conditions and may be an infringement or even a crime:<br />(a) Any unauthorised use or copying of our name, trading style, get-up, confidential information or data (being information of a confidential nature the misuse of which will foreseeably damage our business reputation or goodwill) or copyright material.<br />(b) Unauthorised entry to any non-public part of the Website, including its underlying codes,