 ,(2253,'<p>Soul Patch, Handlebar… what could be more fun than snapping your mates and then \'accidentally\' emailing all their Facebook friends with their \'new\' look….oops! Our addictive new app and Facebook page has enabled Remington to engage with their consumers in a totally new way with over 100,000 European fans on Facebook.</p>\r\n<p> </p>','0.55','0','1444','200','429')
 ,(2254,'<p>Loved by the trade but mostly unknown elsewhere. Global lightbulb giant Sylvania needed a new look that both unified and separated their complex ranges. It lit up sales</p>\r\n<p> </p>','0.55','0','1444','200','429')
 ,(2255,'<p>With own-brands hot on their heels Del Monte asked us to create a global brand vision that would position them as the best. By strengthening core brand values, reinforcing heritage and creating multiple sub brands we successfully expanded Del Monte\'s market share. World Fruits quickly became the best selling juice within the portfolio.</p>\r\n<p> </p>','0.55','0','1444','198','429')
 ,(2256,'<p>Flaunt it. Shake it. We gave this multi-functional product a style makeover as part of a fashion-lead integrated brand campaign. Our innovative approach has helped Remington continually grow and increase its market share by a super-hot 20% yoy. *Source: GfK 52w/e December 2011</p>\r\n<p> </p>','0.55','0','1444','187','429')
 ,(2257,'<p>We created tempting new packaging for Weight Watchers in-meeting products with all the taste and none of the guilt. The indulgent imagery combined with a new easy to understand information system proved so irresistible that it was implemented across all European countries.</p>\r\n<p> </p>','0.55','0','1444','184','470')
 ,(2258,'<p>Just Juice. Sometimes the simple ideas are best…. Take the freshest fruit and squeeze straight into the glass. This simple idea turned around the fortunes of this tired brand, with sales revitalised and more products squeezed onto the shelves than ever before.</p>\r\n<p> </p>','0.55','0','1444','200','429')
 ,(2259,'<p>What\'s hot and what\'s not? Fashion is always changing, that\'s why we created an dynamic interactive e-zine for Remington to encourage a relaxed dialogue with users. Packed with exclusive up to date styling tips it was so successful that the guys demanded one too.</p>\r\n<p> </p>','0.55','0','1444','195','429')
 ,(2260,'<p>Complex businesses don\'t always move in the right direction, especially if you\'re a loss-making franchise. We packed up the old ANC identity and created a dynamic new look that unified and revitalised the company. Within 5 years the newly profitable company was purchased by FedEx for ?110m.</p>\r\n<p> </p>','0.55','0','1444','208','429')
 ,(2261,'<p>We retuned the world to the BBC by helping them sell their highly lucrative content licensing. We adjusted their offering to clearly target potential audiences and maximise merchandising opportunities resulting in major deals in the key emerging markets of Brazil and China.</p>\r\n<p> </p>','0.55','0','1444','198','429')
 ,(2262,'<p>To launch the new innovative Remington Touch Control product we created a joined-up brand launch campaign delivered across numerous touch points. From in-store to online the Touch Control experience was so engaging that at launch it was listed by multiples in 13 European countries.</p>\r\n<p> </p>','0.55','0','1444','184','470')
 ,(2263,'<p><span class=\"emphasize\">FIRST WE TALK...</span> talk about you, your brand, your products, your organisation, your people, your partners, your challenges, your aspirations, your hopes, your fears and your goals.<br /><br /> <span class=\"emphasize\">NEXT, WE THINK...</span> think about key issues, strategies, focus, communication, standout, targeting, innovation and a plan of action. <br /><br /> <span class=\"emphasize\">THEN WE CREATE...</span> create something that the consumer wants, that is needed, that stands out from the crowd, that can be trusted, that you can believe in and that will deliver.</p>','0.55','0','1444','150','689')
